import { createRouter, createWebHistory } from 'vue-router';
import HomePage from './views/HomePage.vue'; // Uverite se da su ovi importi tačni
import DashboardPage from './views/DashboardPage.vue';
import ChildDevelopmentForm from './components/ChildDevelopmentForm.vue';

const routes = [
  { path: '/', component: HomePage },
  { path: '/dashboard', component: DashboardPage },
  { path: '/child-development', component: ChildDevelopmentForm }, // Putanja do komponente
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
